-- Заполняем таблицу votes

SELECT DISTINCT U.* FROM
((SELECT  entity_id
		,entity_type_id
        ,created_by
    --    ,created_at
        ,ROUND(RAND()) AS is_tumb_up
        ,ROUND(RAND() * 100) AS vote_created_by
FROM	entity
ORDER BY RAND() LIMIT 75)
        
